import myImage from './images/Logo.png'

export default function Navbar() {
  return (
    <nav className="nav">
      <img src={myImage} className='img' alt="Project Logo"></img>
      <a href="/" className="site-title">
        Beyond Borders{" "}
      </a>
      <ul>

        <li>
          
          <a href="travel">View Travel Plans</a>
        </li>

        <li>
          <a href="about">About</a>
        </li>
      </ul>
    </nav>
  );
}
